    @Test
    public void testMultiFile() {
        TestUtils.assertTwoGorpipeResults("gor ../tests/data/external/bgen/testfile1_chr1.bgen", "gor -p chr1 ../tests/data/external/bgen/testfile1_chr#{chr}.bgen");
    }

    private static boolean assertProbsAreEqual(String gorResult, String expected) {
        final double tolerance = 0.011;
        final Iterator<Double> sStream = Arrays.stream(gorResult.substring(gorResult.lastIndexOf('\t') + 1).split(",")).flatMap(triple -> Arrays.stream(triple.split(";")).map(Double::parseDouble)).iterator();
        final Iterator<Double> resultStream = Arrays.stream(expected.split("\t")).map(triple -> triple.split(",")).
                flatMap(Arrays::stream).map(UTestGorBGen::separateConcatenatedDoubles).flatMap(Arrays::stream).map(Double::parseDouble).iterator();
        boolean tmp;
        while ((tmp = sStream.hasNext()) && resultStream.hasNext()) {
            final double sNext = sStream.next();
            final double resNext = resultStream.next();
            if (Math.abs(sNext - resNext) > tolerance) {
                return false;
            }
        }
        if (tmp || resultStream.hasNext()) return false;
        return true;
    }

    private static String[] separateConcatenatedDoubles(String s) {
        int idx = s.indexOf('.');
        if (idx < 0 || (idx == 1 && (idx = s.indexOf('.', idx + 1)) < 0)) {
            return new String[] {s};
        } else {
            return new String[] {s.substring(0, idx - 1), s.substring(idx - 1)};
        }
    }
